{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/mohammadbagherehtemam/divvy-cyclistic-bike-trip-data-analysis-with-r?scriptVersionId=272407542\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"e4ba0d40","metadata":{"papermill":{"duration":0.01202,"end_time":"2025-10-31T14:29:29.494307","exception":false,"start_time":"2025-10-31T14:29:29.482287","status":"completed"},"tags":[]},"source":[" # Google Data Analytics Capstone: Cyclistic Bike-Share Analysis\n","\n","## Project Overview\n","\n","This is my capstone project for the Google Data Analytics Professional Certificate. I'm taking on the role of a junior data analyst at Cyclistic, a Chicago-based bike-share company, working on the marketing analytics team.\n","\n","## Objective\n","\n","The marketing director wants to understand how casual riders and annual members use Cyclistic bikes differently. My analysis will help inform a new marketing strategy aimed at converting casual riders into annual members.\n","\n","## Methodology\n","\n","I'm following the structured six-step data analysis process:\n","\n","1. **Ask** - Define the business question\n","2. **Prepare** - Collect and organize data\n","3. **Process** - Clean and transform data\n","4. **Analyze** - Identify patterns and insights\n","5. **Share** - Create visualizations and present findings\n","6. **Act** - Develop actionable recommendations\n","\n"]},{"cell_type":"markdown","id":"ba9d7c3a","metadata":{"papermill":{"duration":0.012521,"end_time":"2025-10-31T14:29:29.517371","exception":false,"start_time":"2025-10-31T14:29:29.50485","status":"completed"},"tags":[]},"source":["# Ask\n","The Ask phase is the initial and most important step of the data analysis process. It serves to properly define the business problem and establish the analytical objectives, ensuring the resulting insights are capable of driving business decisions. The ultimate deliverable from this phase is **A clear statement of the business task**.\n","\n","| Category | Description | Source Reference |\n","| :--- | :--- | :--- |\n","| **Guiding Questions** | What is the problem you are trying to solve? How can your insights drive business decisions? |\n","| **Key Tasks** | Identify the business task. Consider key stakeholders. |\n","| **Deliverable** | A clear statement of the business task. |\n","\n","## Key deliverables you need to produce:\n","* Clear business task statement\n","* Description of data sources\n","* Data cleaning documentation\n","* Analysis summary\n","* Visualizations and key findings\n","* Three top recommendations\n","\n","## Business task \n","The case study has a broader bussiness task \n","\n","> Design marketing strategies aimed at converting casual riders into annual members\n","\n","But only a portion of this bussiness tasked assigned to me and we focus only on that.\n","\n","> Identify how annual members and casual riders use Cyclistic bikes differently.\n","\n","## Key Analysis questions \n","\n","### 1. Temporal Patterns (When do they ride?)\n","- What days of the week do annual members vs. casual riders use bikes most?\n","- What times of day are most popular for each group?\n","- Are there seasonal differences in usage between the two groups?\n","- Do casual riders show different patterns on weekends vs. weekdays compared to members?\n","\n","### 2. Ride Duration (How long do they ride?)\n","- What is the average ride length for annual members vs. casual riders?\n","- What is the distribution of ride lengths for each group?\n","- Are there more short trips or long trips in each category?\n","\n","### 3. Frequency & Volume (How often do they ride?)\n","- How many total rides does each group take?\n","- What percentage of total rides come from each group?\n","- Are there differences in ride frequency throughout the year?\n","\n","### 4. Location Patterns (Where do they ride?)\n","- Which stations are most popular for casual riders vs. members?\n","- Do casual riders and members start/end at different types of locations?\n","- Are there geographic patterns (tourist areas vs. residential/business areas)?\n"]},{"cell_type":"markdown","id":"3f8e5cce","metadata":{"papermill":{"duration":0.010557,"end_time":"2025-10-31T14:29:29.538323","exception":false,"start_time":"2025-10-31T14:29:29.527766","status":"completed"},"tags":[]},"source":["# Prepare Phase - Cyclistic Bike-Share Analysis\n","\n","## Overview\n","In this phase, we identify and describe our data sources, assess their credibility, and understand how they will help answer our business question.\n","\n","---\n","\n","## 1. Where is the Data Located?\n","\n","**Data Source**: Divvy trip data (publicly available historical bike trip data)\n","- **Provider**: Motivate International Inc.\n","- **Access**: Public dataset available for download\n","- **Time Period**: 2019 data (Q1 through Q4)\n","- **Format**: CSV files (one per quarter)\n","- **File Sizes**: \n","  - Q1: 50.53 MB\n","  - Q2: 152.6 MB\n","  - Q3 & Q4: (sizes to be determined)\n","- **License**: [Data License Agreement](https://www.divvybikes.com/data-license-agreement)\n","\n","*Note: Cyclistic is a fictional company. For this case study, we use Divvy's real bike-share data from Chicago.*\n","\n","---\n","\n","## 2. How is the Data Organized?\n","\n","The data is organized in CSV files (one per quarter) with one row per bike trip.\n","\n","### Data Structure by Quarter\n","\n","**Q1, Q3, Q4 (Similar Structure - 12 columns):**\n","- `trip_id`: Unique identifier for each trip\n","- `start_time`: Trip start date and time\n","- `end_time`: Trip end date and time\n","- `bikeid`: Bike identifier\n","- `tripduration`: Trip duration in seconds\n","- `from_station_id`: Starting station ID\n","- `from_station_name`: Starting station name\n","- `to_station_id`: Ending station ID\n","- `to_station_name`: Ending station name\n","- `usertype`: Customer type (**Subscriber** or **Customer**)\n","- `gender`: Rider gender (Male/Female)\n","- `birthyear`: Birth year of rider\n","\n","**Q2 (Different Structure - appears to have 12 columns but different names):**\n","- `01 - Rental Details Rental ID`: Trip identifier\n","- `01 - Rental Details Local Start Time`: Trip start date and time\n","- `01 - Rental Details Local End Time`: Trip end date and time\n","- `01 - Rental Details Bike ID`: Bike identifier\n","- `01 - Rental Details Duration In Seconds Uncapped`: Trip duration\n","- `03 - Rental Start Station ID`: Starting station ID\n","- `03 - Rental Start Station Name`: Starting station name\n","- `02 - Rental End Station ID`: Ending station ID\n","- `02 - Rental End Station Name`: Ending station name\n","- `User Type`: Customer type (Subscriber/Customer)\n","- *(Gender and birthyear columns may exist but not visible in preview)*\n","\n","**Key Observation**: Q2 uses different column naming conventions than the other quarters. This inconsistency must be addressed during the Process phase.\n","\n","---\n","\n","## 3. Does the Data ROCCC?\n","\n","### **R**eliable\n","✅ Yes - Data comes directly from the bike-share system that automatically tracks all trips.\n","\n","### **O**riginal\n","✅ Yes - This is first-party data collected directly from bike-sharing operations.\n","\n","### **C**omprehensive\n","✅ Yes - Includes trip times, locations, bike types, and customer types needed for our analysis.\n","\n","### **C**urrent\n","✅ Yes - Using the most recent 12 months reflects current usage patterns.\n","\n","### **C**ited\n","✅ Yes - Data is properly licensed by Motivate International Inc.\n","\n","---\n","\n","## 4. Licensing, Privacy, and Data Limitations\n","\n","### Licensing\n","- Data is publicly available under Motivate International Inc.'s license\n","- Free to use for analysis purposes\n","\n","### Privacy\n","The dataset does **NOT** include personally identifiable information:\n","- No rider names\n","- No credit card numbers\n","- No home addresses\n","- No contact information\n","\n","### What This Means for Our Analysis\n","We **cannot**:\n","- Track individual casual riders across multiple trips\n","- Determine where casual riders live\n","- Connect multiple purchases by the same casual rider\n","\n","We **can**:\n","- Compare aggregate behavior between member and casual groups\n","- Analyze usage patterns, trip duration, and location preferences\n","- Identify trends by time and season\n","\n","---\n","\n","## 5. How Does This Data Help Answer Our Question?\n","\n","This dataset allows us to compare **Subscriber** (annual member) and **Customer** (casual rider) behavior through:\n","\n","1. **Temporal Analysis**: When do they ride? \n","   - Using `start_time` and `end_time` fields\n","   - Can extract day of week, hour of day, month/season\n","   \n","2. **Duration Analysis**: How long do they ride?\n","   - `tripduration` field provides trip length in seconds\n","   \n","3. **Frequency Analysis**: How often do they ride?\n","   - Count of trips by `usertype`\n","   \n","4. **Location Analysis**: Where do they ride?\n","   - Station names and IDs show popular locations\n","   - Can identify patterns in start/end stations\n","   \n","5. **Demographic Insights** (bonus):\n","   - `gender` and `birthyear` provide additional context\n","\n","**Note**: The dataset uses **\"Subscriber\"** for annual members and **\"Customer\"** for casual riders.\n","\n","---\n","\n","## 6. Are There Problems With the Data?\n","\n","### Identified Issues:\n","\n","**1. Inconsistent Column Names (Critical)**\n","- Q2 has completely different column naming conventions than Q1, Q3, Q4\n","- Example: `trip_id` (Q1) vs `01 - Rental Details Rental ID` (Q2)\n","- **Impact**: Cannot directly combine files without renaming columns first\n","\n","**2. Different Customer Type Labels**\n","- Data uses \"Subscriber\" and \"Customer\" instead of \"member\" and \"casual\"\n","- **Subscriber** = Annual member\n","- **Customer** = Casual rider (single-ride or full-day pass)\n","\n","**3. Additional Demographic Data**\n","- This dataset includes `gender` and `birthyear` fields\n","- These fields may help with deeper analysis but are not required for the primary question\n","\n","**4. Potential Data Quality Issues** (to check in Process phase):\n","- Missing values in some fields\n","- Possible duplicate records\n","- Trips with unusual durations (too short or too long)\n","- Incomplete station information\n","\n","These issues will be addressed during data processing.\n","\n","---\n","\n","## Summary\n","\n","**Data Source**: Divvy 2019 trip data (Q1-Q4)  \n","**Total Files**: 4 CSV files (one per quarter)  \n","**Credibility**: High - Reliable, Original, Comprehensive, Current, and Cited  \n","**Suitable for Analysis**: Yes - Contains all necessary fields to compare Subscriber vs. Customer behavior  \n","**Key Finding**: Q2 has different column names - this must be standardized in Process phase  \n","**Customer Types**: Subscriber = Annual Member | Customer = Casual Rider  \n","**Limitations**: No personal information; cannot track individual customers over time\n","\n","---"]},{"cell_type":"markdown","id":"5068bffe","metadata":{"papermill":{"duration":0.010958,"end_time":"2025-10-31T14:29:29.559726","exception":false,"start_time":"2025-10-31T14:29:29.548768","status":"completed"},"tags":[]},"source":["Process phase cyclistic · MD\n","Copy\n","\n","# Process Phase - Cyclistic Bike-Share Analysis\n","\n","## Overview\n","In this phase, we clean and transform the data to prepare it for analysis. We'll use R and Tidyverse to ensure data integrity and create a unified dataset from all four quarters.\n","\n","---\n","\n","## 1. What Tools Are You Choosing and Why?\n","\n","### Tools Selected: R and Tidyverse\n","\n","**Why R and Tidyverse?**\n","- **Efficiency**: R handles large datasets well (our files are 50-150 MB each)\n","- **Data Manipulation**: Tidyverse packages (dplyr, tidyr) make data cleaning intuitive\n","- **Reproducibility**: R scripts document every step of the cleaning process\n","- **Visualization**: ggplot2 (part of Tidyverse) creates professional visualizations\n","- **Learning Goal**: Aligns with the case study recommendation and course material\n","\n","**Key Packages to Use:**\n","- `tidyverse`: For data manipulation and visualization\n","- `lubridate`: For working with dates and times\n","- `here`: For file path management\n","\n","---\n","\n","## 2. Data Integrity Checks\n","\n","Before cleaning, we need to verify our data's integrity:\n","\n","### Initial Checks\n","1. **File Completeness**: Confirm all 4 quarterly files are downloaded\n","2. **File Size Validation**: Check that files aren't corrupted\n","   - Q1: ~50 MB \n","   - Q2: ~153 MB\n","   - Q3 ~225 MB\n","   - Q4: ~ 97 MB\n","3. **Column Count**: Verify expected number of columns in each file\n","4. **Data Types**: Check that numeric fields are numeric, dates are dates\n","\n","### Data Quality Issues to Identify\n","- Missing values (NA, blank cells)\n","- Duplicate trip IDs\n","- Negative or zero trip durations\n","- Invalid dates (future dates, end_time before start_time)\n","- Missing station names or IDs\n","- Outliers in trip duration (extremely long or short trips)\n","\n","\n"]},{"cell_type":"markdown","id":"370ba4ea","metadata":{"papermill":{"duration":0.010258,"end_time":"2025-10-31T14:29:29.580532","exception":false,"start_time":"2025-10-31T14:29:29.570274","status":"completed"},"tags":[]},"source":["## 3. Data Cleaning Steps\n","\n","### Step 1: Insall and Load Libraries"]},{"cell_type":"code","execution_count":1,"id":"23a0a9c5","metadata":{"execution":{"iopub.execute_input":"2025-10-31T14:29:29.605869Z","iopub.status.busy":"2025-10-31T14:29:29.603625Z","iopub.status.idle":"2025-10-31T14:32:43.709403Z","shell.execute_reply":"2025-10-31T14:32:43.707533Z"},"papermill":{"duration":194.128042,"end