ata"}],"source":["# Check if start and end stations are the same (round trips)\n","round_trip_analysis <- all_trips_clean %>% \n","  mutate(is_round_trip = from_station_name == to_station_name) %>% \n","  group_by(member_casual, is_round_trip) %>% \n","  summarise(\n","    count = n(),\n","    .groups = 'drop'\n","  ) %>% \n","  group_by(member_casual) %>% \n","  mutate(percentage = count / sum(count) * 100)\n","\n","print(round_trip_analysis)\n","\n","# Visualize\n","ggplot(round_trip_analysis, aes(x = member_casual, y = percentage, fill = is_round_trip)) +\n","  geom_col(position = \"dodge\") +\n","  labs(\n","    title = \"Round Trip vs One-Way Trips\",\n","    x = \"User Type\",\n","    y = \"Percentage\",\n","    fill = \"Round Trip?\"\n","  ) +\n","  theme_minimal()\n","\n","ggsave(\"round_trip_vs_one_way_trips.png\")"]},{"cell_type":"markdown","id":"987290e3","metadata":{"papermill":{"duration":0.02553,"end_time":"2025-10-31T14:35:05.520092","exception":false,"start_time":"2025-10-31T14:35:05.494562","status":"completed"},"tags":[]},"source":["### Key findings Summary "]},{"cell_type":"code","execution_count":27,"id":"c832e3ff","metadata":{"execution":{"iopub.execute_input":"2025-10-31T14:35:05.575697Z","iopub.status.busy":"2025-10-31T14:35:05.574045Z","iopub.status.idle":"2025-10-31T14:35:05.814244Z","shell.execute_reply":"2025-10-31T14:35:05.812448Z"},"papermill":{"duration":0.270584,"end_time":"2025-10-31T14:35:05.816652","exception":false,"start_time":"2025-10-31T14:35:05.546068","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\u001b[90m# A tibble: 2 × 6\u001b[39m\n","  member_casual total_rides avg_ride_length_min median_ride_length_min\n","  \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m               \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m               \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m                  \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m\n","\u001b[90m1\u001b[39m casual             \u001b[4m8\u001b[24m\u001b[4m7\u001b[24m\u001b[4m9\u001b[24m284                39.4                   25.8\n","\u001b[90m2\u001b[39m member            2\u001b[4m9\u001b[24m\u001b[4m3\u001b[24m\u001b[4m6\u001b[24m859                12.9                    9.8\n","\u001b[90m# ℹ 2 more variables: max_ride_length_min <dbl>, percentage_of_total <dbl>\u001b[39m\n"]}],"source":["summary_table <- all_trips_clean %>% \n","  group_by(member_casual) %>% \n","  summarise(\n","    total_rides = n(),\n","    avg_ride_length_min = mean(ride_length_min),\n","    median_ride_length_min = median(ride_length_min),\n","    max_ride_length_min = max(ride_length_min),\n","    .groups = 'drop'\n","  ) %>% \n","  mutate(percentage_of_total = total_rides / sum(total_rides) * 100)\n","\n","print(summary_table)\n","write_csv(summary_table, \"summary_statistics.csv\")\n","\n"]},{"cell_type":"markdown","id":"6c121996","metadata":{"papermill":{"duration":0.025547,"end_time":"2025-10-31T14:35:05.867935","exception":false,"start_time":"2025-10-31T14:35:05.842388","status":"completed"},"tags":[]},"source":["### Expor Analysis Results"]},{"cell_type":"code","execution_count":28,"id":"8b8dc604","metadata":{"execution":{"iopub.execute_input":"2025-10-31T14:35:05.923107Z","iopub.status.busy":"2025-10-31T14:35:05.921356Z","iopub.status.idle":"2025-10-31T14:35:05.9663Z","shell.execute_reply":"2025-10-31T14:35:05.964377Z"},"papermill":{"duration":0.075694,"end_time":"2025-10-31T14:35:05.969274","exception":false,"start_time":"2025-10-31T14:35:05.89358","status":"completed"},"tags":[]},"outputs":[],"source":["# Export key analysis results for reporting\n","\n","# 1. Day of week analysis\n","write_csv(avg_ride_by_day, \"avg_ride_by_day.csv\")\n","write_csv(rides_by_day, \"rides_by_day.csv\")\n","\n","# 2. Monthly analysis\n","write_csv(monthly_analysis, \"monthly_analysis.csv\")\n","\n","# 3. Top stations\n","write_csv(top_casual_start, \"top_casual_start_stations.csv\")\n","write_csv(top_member_start, \"top_member_start_stations.csv\")\n","\n","# 4. Overall summary\n","write_csv(summary_table, \"overall_summary.csv\")"]},{"cell_type":"markdown","id":"92d72b0b","metadata":{"papermill":{"duration":0.025363,"end_time":"2025-10-31T14:35:06.020299","exception":false,"start_time":"2025-10-31T14:35:05.994936","status":"completed"},"tags":[]},"source":["# Key Findings - Cyclistic Bike-Share Analysis\n","\n","**Question:** How do annual members and casual riders use Cyclistic bikes differently?\n","\n","**Data:** 3.8 million trips from 2019  \n","**Tools:** R, tidyverse, ggplot2\n","\n","---\n","\n","## Main Finding\n","\n","Members and casual riders use bikes for different purposes:\n","- **Members (77% of rides)**: Short weekday trips for commuting\n","- **Casual riders (23% of rides)**: Longer weekend trips for leisure\n","\n","---\n","\n","## 1. Ride Duration\n","\n","**Data:**\n","- Casual riders: 38-42 minutes average\n","- Members: 12-14 minutes average\n","\n","**Observation:**\n","Casual riders take 3x longer trips. This suggests they're exploring and enjoying the ride, while members are getting from point A to B quickly.\n","\n","---\n","\n","## 2. Day of Week Patterns: Members Ride on Weekdays, Casual Riders on Weekends\n","\n","### What I Found\n","\n","When I looked at the number of rides by day of week, I found a clear pattern:\n","\n","**Weekday vs Weekend Split:**\n","- Members: 2,393,601 weekday rides (81% of their total trips)\n","- Casual: 501,592 weekday rides (57% of their total trips)\n","- Members: 543,258 weekend rides (19% of their total trips)\n","- Casual: 377,692 weekend rides (43% of their total trips)\n","\n","**Looking at Individual Days:**\n","\n","For Members, the busiest days are:\n","- Tuesday: 496,951 rides\n","- Wednesday: 494,205 rides\n","- Thursday: 486,837 rides\n","- Sunday (lowest): 256,180 rides\n","\n","For Casual Riders:\n","- Saturday: 207,758 rides (highest)\n","- Sunday: 169,934 rides\n","- Tuesday: 88,495 rides (lowest)\n","- Wednesday: 89,601 rides (lowest)\n","\n","### My Interpretation\n","\n","**Members show what looks like commuting behavior:**\n","- They ride most on typical work days (Tuesday-Thursday)\n","- 81% of their trips happen Monday-Friday\n","- Usage drops significantly on weekends\n","- This pattern matches typical work schedules\n","\n","**Casual riders show what looks like recreational behavior:**\n","- Their highest usage is on Saturday and Sunday\n","- Weekend trips make up 43% of their total (much higher than members)\n","- Their rides are more evenly distributed across the week\n","- This suggests flexible, leisure-based usage\n","\n","### What This Could Mean\n","The weekend casual riders are particularly interesting because they're already regular users of the service. They might be good candidates for membership if we could show them how bikes could also work for their weekday commute, not just weekend fun.\n","\n","---\n","\n","## 3. Time of Day Patterns: Different Peak Hours\n","\n","### What I Found\n","\n","When I analyzed rides by hour of day, I created a line chart that showed very different patterns:\n","\n","**Members:**\n","- Clear morning peak around 8 AM (~280,000 rides)\n","- Even larger evening peak around 5 PM (~390,000 rides)\n","- Lower usage during midday and overnight\n","- The pattern creates an \"M\" shape on the chart\n","\n","**Casual riders:**\n","- Rides start low in the morning (~20,000 at 7 AM)\n","- Gradually increase throughout the day\n","- Peak in late afternoon around 5 PM (~85,000 rides)\n","- More evenly distributed across the day\n","\n","### My Interpretation\n","\n","**Members' pattern looks like typical commuting:**\n","- The 8 AM and 5 PM peaks match standard work hours\n","- Low usage very early and very late (when people aren't commuting)\n","- The consistent daily pattern suggests routine use\n","- This is what I would expect from people using bikes to get to/from work\n","\n","**Casual riders' pattern looks more flexible:**\n","- They start using bikes later in the morning\n","- Usage builds throughout the day (perhaps as the weather warms up)\n","- No sharp peaks like members have\n","- This suggests less time pressure and more spontaneous use\n","\n","### What This Could Mean\n","Members are likely using bikes as part of their daily work routine, while casual riders seem to be using them when it's convenient for leisure. This reinforces the idea that casual riders might not be thinking about bikes as a commuting solution.\n","\n","---\n","\n","## 4. Seasonal Patterns: Casual Riders Are Very Weather-Dependent\n","\n","### What I Found\n","\n","When I grouped rides by month, I noticed that casual riders' usage varies dramatically by season:\n","\n","**Casual Rider Monthly Pattern:**\n","- Winter (Jan-Feb): Only 2,627-4,591 rides per month\n","- Spring (Mar-May): Growing from 15,877 to 81,506 rides\n","- Summer (Jun-Aug): Peak at 130,065-186,624 rides per month\n","- Fall (Sep-Oct): Declining from 128,988 to 70,889 rides\n","\n","**Key Observation:**\n","- Peak month: August with 186,624 casual rides\n","- Lowest month: February with only 2,627 casual rides\n","- That's a 98% drop from peak to lowest!\n","\n","**Members are more consistent:**\n","- They still have seasonal variation but maintain 100,000-400,000 rides throughout the year\n","- Much less dramatic drops in winter months\n","\n","### My Interpretation\n","\n","**Casual riders seem to be fair-weather users:**\n","- Their usage almost disappears in winter (98% decrease)\n","- They're most active during tourist season (June-August)\n","- They seem to stop using bikes when it gets cold\n","- This suggests bikes are viewed as a seasonal/recreational activity\n","\n","**Members maintain year-round usage:**\n","- While they also prefer nice weather, usage stays substantial\n","- This could be because commuting is a necessity regardless of weather\n","- Less flexibility in their usage patterns\n","\n","### What This Could Mean\n","This seasonal pattern is really important because it shows that casual riders currently see Cyclistic as a \"summer activity.\" If we want to convert them to members, we might need to time our campaigns for late summer/early fall when they're actively using the service but before they stop for the winter.\n","\n","---\n","\n","## 5. Station Locations: Different Areas of the City\n","\n","### What I Found\n","\n","I looked at the top 10 starting stations for each group and found they're using completely different parts of Chicago:\n","\n","**Top Starting Stations - Casual Riders:**\n","\n","| Station | Rides | What I Noticed |\n","|---------|-------|----------------|\n","| Streeter Dr & Grand Ave | 53,071 | Near Navy Pier |\n","| Lake Shore Dr & Monroe St | 39,209 | Lakefront area |\n","| Millennium Park | 21,728 | Major tourist spot |\n","| Michigan Ave & Oak St | 21,370 | Shopping area |\n","| Shedd Aquarium | 20,609 | Tourist attraction |\n","| Lake Shore Dr & North Blvd | 18,932 | Lakefront |\n","| Theater on the Lake | 15,015 | Recreation area |\n","| Dusable Harbor | 12,536 | Waterfront |\n","\n","**Top Starting Stations - Members:**\n","\n","| Station | Rides | What I Noticed |\n","|---------|-------|----------------|\n","| Canal St & Adams St | 50,569 | Downtown Loop |\n","| Clinton St & Madison St | 45,986 | West Loop/Transit area |\n","| Clinton St & Washington Blvd | 45,375 | West Loop |\n","| Columbus Dr & Randolph St | 31,369 | Loop area |\n","| Franklin St & Monroe St | 30,828 | Business district |\n","| Kingsbury St & Kinzie St | 30,650 | Business area |\n","| Daley Center Plaza | 30,420 | Downtown |\n","\n","### My Interpretation\n","\n","**Casual riders concentrate at tourist and recreation spots:**\n","- Streeter Dr (Navy Pier area) is their #1 station by far\n","- Lakefront and parks dominate their top 10\n","- These are places people go for fun and sightseeing\n","- All focused on scenic, recreational areas\n","\n","**Members use business district and transit stations:**\n","- Loop and West Loop areas (where people work)\n","- Spread across different neighborhoods\n","- Near transit hubs (good for commuting connections)\n","- Less concentrated in one area\n","\n","### What This Could Mean\n","The location data really reinforces everything else I found. Casual riders are concentrated in tourist areas where they're having fun, while members are spread across work and residential areas. This geographic difference shows they're using the bikes for completely different purposes.\n","\n","For marketing, this is helpful because we know exactly where casual riders are - we could put targeted messages at Streeter Dr, Millennium Park, and Shedd Aquarium stations.\n","\n","---\n","\n","## 6. Round Trips: Casual Riders Return to Starting Point More Often\n","\n","### What I Found\n","I checked whether riders ended their trip at the same station where they started:\n","\n","- **Casual riders**: 11.9% round trips (104,452 out of 879,284 total rides)\n","- **Members**: 1.6% round trips (47,533 out of 2,936,859 total rides)\n","\n","### My Interpretation\n","\n","**Casual riders do more \"there and back\" trips:**\n","- About 1 in 8 casual rides returns to the same station\n","- This pattern fits with recreational use - maybe exploring an area then returning\n","- Could be riding along the lakefront and coming back to where they started\n","- Suggests less goal-oriented trips\n","\n","**Members almost always go point-to-point:**\n","- Only 1 in 60 member rides returns to the starting station\n","- 98.4% are one-way trips\n","- This makes sense for commuting - going from home to work, or work to transit\n","- More practical, transportation-focused usage\n","\n","### What This Could Mean\n","This is another piece of evidence that casual riders are using bikes for leisure (circular routes, exploring) while members use them for transportation (getting from A to B). For conversion messaging, we could emphasize that membership makes sense for everyday trips to work, errands, etc., not just recreational loops.\n","\n","---\n","\n","## Summary: How Members and Casual Riders Differ\n","\n","| Factor | Members | Casual Riders |\n","|--------|---------|---------------|\n","| **Purpose** | Daily commuting & transportation | Leisure & recreation |\n","| **Trip Length** | 12-14 minutes (short, efficient) | 38-42 minutes (long, exploratory) |\n","| **Peak Days** | Weekdays (81% of trips) | Weekends (43% of trips) |\n","| **Time Pattern** | Rush hour peaks (8 AM, 5 PM) | Spread throughout day |\n","| **Seasonality** | Year-round consistent usage | Highly seasonal (summer peak) |\n","| **Locations** | Business districts & transit hubs | Tourist attractions & lakefront |\n","| **Trip Type** | 98.4% one-way trips | 11.9% round trips |\n","| **Volume** | 2.9M rides (77%) | 879K rides (23%) |\n","\n","---\n","\n","## Answer to Business Question\n","\n","### How do annual members and casual riders use Cyclistic bikes differently?\n","\n","Based on my analysis of 3.8 million rides in 2019, I found that annual members and casual riders use Cyclistic bikes for fundamentally different purposes:\n","\n","**Annual members appear to use Cyclistic as everyday transportation.** They take short trips (12-14 minutes on average) during weekday rush hours, primarily between business districts and transit hubs. Their usage is consistent throughout the year, which suggests that bikes are a regular part of their daily commute. Almost all of their trips (98.4%) are one-way, going from point A to point B.\n","\n","**Casual riders seem to use Cyclistic for weekend recreation.** They take much longer trips (38-42 minutes on average), with peak usage on weekends and during summer months. They're concentrated at tourist attractions and lakefront areas. Their usage drops by 98% in winter, which indicates they view bikes as a seasonal leisure activity rather than year-round transportation.\n","\n","**Why this matters:** The data shows that casual riders already enjoy using Cyclistic bikes - they're just using them differently than members. The opportunity for conversion lies in helping casual riders see that bikes can be more than just weekend fun - they can also be a practical, cost-effective solution for everyday transportation needs.\n","\n","This is an important insight because it suggests we shouldn't try to change how casual riders currently use bikes. Instead, we should help them see an additional use case: weekday commuting and errands.\n","\n","---\n","\n","## Next Steps\n","\n","Based on what I learned from this analysis, I'm ready to develop three recommendations for converting casual riders into annual members. \n","\n","I'm thinking about focusing on:\n","1. How we can communicate the value of bikes for everyday use, not just recreation\n","2. Where and when to reach casual riders (at their high-traffic stations during peak casual usage times)\n","3. Emphasizing cost savings for people who might want to use bikes for short, frequent trips\n","4. Timing our campaigns for late summer when casual riders are actively using bikes but before winter\n","\n","---"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1396462,"sourceId":2314127,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":340.497411,"end_time":"2025-10-31T14:35:06.368949","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-10-31T14:29:25.871538","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}